static int yy_init_globals (void)
{
        /* Initialization is the same as for the non-reentrant scanner.
     * This function is called from parse_fortran_YYlex_destroy(), so don't allocate here.
     */

    (yy_buffer_stack) = 0;
    (yy_buffer_stack_top) = 0;
    (yy_buffer_stack_max) = 0;
    (yy_c_buf_p) = (char *) 0;
    (yy_init) = 0;
    (yy_start) = 0;

    (yy_start_stack_ptr) = 0;
    (yy_start_stack_depth) = 0;
    (yy_start_stack) =  NULL;

    (yy_state_buf) = 0;
    (yy_state_ptr) = 0;
    (yy_full_match) = 0;
    (yy_lp) = 0;

/* Defined in main.c */
#ifdef YY_STDINIT
    parse_fortran_YYin = stdin;
    parse_fortran_YYout = stdout;
#else
    parse_fortran_YYin = (FILE *) 0;
    parse_fortran_YYout = (FILE *) 0;
#endif

    /* For future reference: Set errno on error, since we are called by
     * parse_fortran_YYlex_init()
     */
    return 0;
}

/* parse_fortran_YYlex_destroy is for both reentrant and non-reentrant scanners. */
int parse_fortran_YYlex_destroy  (void)
{
    
    /* Pop the buffer stack, destroying each element. */
	while(YY_CURRENT_BUFFER){
		parse_fortran_YY_delete_buffer(YY_CURRENT_BUFFER  );
		YY_CURRENT_BUFFER_LVALUE = NULL;
		parse_fortran_YYpop_buffer_state();
	}

	/* Destroy the stack itself. */
	parse_fortran_YYfree((yy_buffer_stack) );
	(yy_buffer_stack) = NULL;

    /* Destroy the start condition stack. */
        parse_fortran_YYfree((yy_start_stack)  );
        (yy_start_stack) = NULL;

    parse_fortran_YYfree ( (yy_state_buf) );
    (yy_state_buf)  = NULL;

    /* Reset the globals. This is important in a non-reentrant scanner so the next time
     * parse_fortran_YYlex() is called, initialization will occur. */
    yy_init_globals( );

    return 0;
}

